import styled from 'styled-components';

const Logo = styled.div`
    width: 100%;
    display: flex;
    flex-direction: column;
    margin-bottom: 48px;
    justify-content: center;
    align-items: center;
    flex-shrink: 0;

    h1 {
        margin-bottom: 0;
    }
`;

export default Logo;
